--
-- 行政区域表
--
-- v1.0 2014.12.08
-- author：wing
--
-- 修改历史：
--
--
-- Drop Table fxp.p_regionalism;
create Table  fxp.p_regionalism (
-- +-----------------------------+--------------+-----------+
   fregion_id                    varchar2(32)   not null,   -- 行政区域ID
   fregion_code                  varchar2(20)   not null,   -- 行政区域代码
   fregion_gbcode                varchar2(30),              -- 行政区域国标代码
   fregion_name                  varchar2(40)   not null,   -- 行政区域名称
   fat_class                     varchar2(1)    not null,   -- 区域类型 1 省 2 市 3 区 4 乡镇(街道）  5 居委会
   fat_province_id               varchar2(30),              -- 所在省ID(->行政区域ID)
   fat_city_id                   varchar2(30),              -- 所在市ID(->行政区域ID)
   fat_district_id               varchar2(30),              -- 所在区县ID(->行政区域ID)
   fat_street_id                 varchar2(30),              -- 所在乡镇ID(->行政区域ID)
   fat_committee_id              varchar2(30),              -- 所在居委会ID(->行政区域ID)
   fisavailable                  char(1)        not null,   -- 是否可用?
   fordernum                     number(6,2)    not null,   -- 排序号(本类型记录的排序号)
   fregion_desc                  varchar2(256),             -- 描述
   --
   -- 日志
   --
   fversion                      number(6)                  -- 版本号
                                 default 0      not null,
   flogcby                       varchar2(32)   not null,   -- 创建者
   flogcdate                     date default sysdate not null,   -- 创建时间
   flogluby                      varchar2(32)   not null,   -- 最后修改者
   flogludate                    date default sysdate not null,   -- 最后修改时间
   floglaby                      varchar2(32)   not null,   -- 最后访问者
   flogladate                    date default sysdate not null,   -- 最后访问时间
   --
   -- 主键、唯一键
   --
   constraint pk_p_regionalism primary key (fregion_Id),
   --
   -- 约束
   --
   constraint ck_p_regionalism_at_class   check (fat_class in ('1','2','3','4','5'))
   );

--
-- 同义词
--

--
-- 外部键约束
--
--
-- 授权
--
grant all on  fxp.p_regionalism to sf,hbcs ;
